description:
Продаётся просторная и уютная 2-х комнатная квартира.
* В квартире сделан хороший ремонт;
* Квартира полностью готова к проживанию;
* Два с/у, лоджия, гардеробная, кухня 13,4 м2, комнаты 17 м2 и 11 м2;
* Хороший вид из окон (вид во двор);
* Один собственник (2018 г. ДДУ), никто не зарегистрирован;
* В пешей доступности вся инфраструктура: школа, детсад, магазины и прочие центры услуг;
* Ближайшее станция метро Некрасовка (1,4 км. или 15-20 мин пешком);
* ПРОПИСКА МОСКВА;
* Ипотека возможна;
Звоните, показ в любое ваше время.. Лот 118117
